CREATE DEFINER=`root`@`localhost` PROCEDURE `GateHistoryReport`()
    NO SQL
SELECT s.studentId,p.card_id,pn.firstName, pn.lastname
FROM gate_history gh
LEFT JOIN party_stdconnector p on p.card_id = gh.card_id
LEFT JOIN student s on p.partyId = s.studentNumber
LEFT JOIN person pn on pn.personId = s.personId$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GateScanTopUp`()
    NO SQL
SELECT pi.image_url,ps.partyId,gh.createDate,ps.card_id
FROM gate_history gh
JOIN party_stdconnector ps on ps.card_id = gh.card_id
JOIN person_image pi on pi.partyId = ps.partyId
ORDER BY gh.transaction_id DESC
LIMIT 1$$

